import React from 'react';

import ModalDialog from '../../../common/ModalDialog';
import SignInForm from '../SignInForm';
import { SIGN_IN_MODAL } from '../../constants';

const SignInModal = () => {
    const props = {
        form: 'SIGN_IN_FORM'
    };

    return (
        <ModalDialog {...SIGN_IN_MODAL}>
            <SignInForm {...props} />
        </ModalDialog>
    );
}

export default SignInModal;
